function ExpenseDate() {
  return;
  const month = props.date.toLocaleString("en-ZA", { month: "long" });
  const day = props.date.toLocaleString("en-ZA", { day: "2-digit" });
  const year = props.date.getFullYear();
}

export default ExpenseDate;
